import React, { useState } from 'react';
import {
  Box,
  Typography,
  Container,
  Card,
  CardContent,
  CardActions,
  Button,
  Chip,
  Grid,
  ToggleButton,
  ToggleButtonGroup,
  Paper,
} from '@mui/material';
import {
  GitHub,
  Launch,
  Star,
} from '@mui/icons-material';

const Projects = () => {
  const [activeFilter, setActiveFilter] = useState('all');

  const projects = [
    {
      id: 1,
      title: 'E-Commerce Platform',
      description: 'A full-stack e-commerce platform built with React, Node.js, and MongoDB. Features include user authentication, product catalog, shopping cart, and payment integration.',
      image: 'ðŸ›’',
      technologies: ['React', 'Node.js', 'MongoDB', 'Express', 'Stripe'],
      category: 'fullstack',
      github: '#',
      demo: '#',
      featured: true
    },
    {
      id: 2,
      title: 'Task Management App',
      description: 'A collaborative task management application with real-time updates, drag-and-drop functionality, and team collaboration features.',
      image: 'ðŸ“‹',
      technologies: ['React', 'Socket.io', 'PostgreSQL', 'Node.js'],
      category: 'frontend',
      github: '#',
      demo: '#',
      featured: true
    },
    {
      id: 3,
      title: 'Weather Prediction ML Model',
      description: 'Machine learning model that predicts weather patterns using historical data. Built with Python, TensorFlow, and deployed with Flask API.',
      image: 'ðŸŒ¤ï¸',
      technologies: ['Python', 'TensorFlow', 'Flask', 'Pandas', 'Scikit-learn'],
      category: 'ml',
      github: '#',
      demo: '#',
      featured: false
    },
    {
      id: 4,
      title: 'Social Media Dashboard',
      description: 'Analytics dashboard for social media metrics with data visualization, real-time updates, and customizable widgets.',
      image: 'ðŸ“Š',
      technologies: ['Vue.js', 'D3.js', 'Firebase', 'Chart.js'],
      category: 'frontend',
      github: '#',
      demo: '#',
      featured: false
    },
    {
      id: 5,
      title: 'Blockchain Voting System',
      description: 'Secure voting system built on blockchain technology ensuring transparency and immutability of votes.',
      image: 'ðŸ—³ï¸',
      technologies: ['Solidity', 'Web3.js', 'React', 'Ethereum'],
      category: 'blockchain',
      github: '#',
      demo: '#',
      featured: true
    },
    {
      id: 6,
      title: 'Mobile Fitness Tracker',
      description: 'Cross-platform mobile app for fitness tracking with workout plans, progress monitoring, and social features.',
      image: 'ðŸ’ª',
      technologies: ['React Native', 'Firebase', 'Redux', 'Expo'],
      category: 'mobile',
      github: '#',
      demo: '#',
      featured: false
    }
  ];

  const filters = [
    { key: 'all', label: 'All Projects' },
    { key: 'fullstack', label: 'Full Stack' },
    { key: 'frontend', label: 'Frontend' },
    { key: 'ml', label: 'Machine Learning' },
    { key: 'mobile', label: 'Mobile' },
    { key: 'blockchain', label: 'Blockchain' }
  ];

  const filteredProjects = activeFilter === 'all' 
    ? projects 
    : projects.filter(project => project.category === activeFilter);

  const handleFilterChange = (event, newFilter) => {
    if (newFilter !== null) {
      setActiveFilter(newFilter);
    }
  };

  return (
    <Container maxWidth="lg" sx={{ py: 8 }}>
      {/* Header */}
      <Box sx={{ textAlign: 'center', mb: 6 }}>
        <Typography
          variant="h2"
          sx={{
            mb: 2,
            background: 'linear-gradient(135deg, #ffffff, #4dabf7)',
            backgroundClip: 'text',
            WebkitBackgroundClip: 'text',
            WebkitTextFillColor: 'transparent',
            position: 'relative',
            '&::after': {
              content: '""',
              position: 'absolute',
              bottom: -10,
              left: '50%',
              transform: 'translateX(-50%)',
              width: 60,
              height: 4,
              background: 'linear-gradient(135deg, #4dabf7, #f50057)',
              borderRadius: 2,
            },
          }}
        >
          My Projects
        </Typography>
        <Typography
          variant="h6"
          sx={{ color: 'text.secondary', maxWidth: 600, mx: 'auto' }}
        >
          Things I've built and worked on
        </Typography>
      </Box>

      {/* Filter Buttons */}
      <Box sx={{ display: 'flex', justifyContent: 'center', mb: 4 }}>
        <ToggleButtonGroup
          value={activeFilter}
          exclusive
          onChange={handleFilterChange}
          sx={{
            flexWrap: 'wrap',
            gap: 1,
            '& .MuiToggleButton-root': {
              border: '2px solid rgba(74, 171, 247, 0.3)',
              borderRadius: '25px',
              px: 3,
              py: 1,
              color: 'text.secondary',
              '&.Mui-selected': {
                background: 'linear-gradient(135deg, #4dabf7, #f50057)',
                color: 'white',
                border: '2px solid transparent',
                '&:hover': {
                  background: 'linear-gradient(135deg, #339af0, #c51162)',
                },
              },
              '&:hover': {
                borderColor: '#4dabf7',
                color: '#4dabf7',
              },
            },
          }}
        >
          {filters.map((filter) => (
            <ToggleButton key={filter.key} value={filter.key}>
              {filter.label}
            </ToggleButton>
          ))}
        </ToggleButtonGroup>
      </Box>

      {/* Projects Grid */}
      <Grid container spacing={3} sx={{ mb: 6 }}>
        {filteredProjects.map((project) => (
          <Grid item xs={12} md={6} lg={4} key={project.id}>
            <Card
              sx={{
                height: '100%',
                display: 'flex',
                flexDirection: 'column',
                position: 'relative',
                transition: 'all 0.3s ease',
                border: project.featured ? '2px solid #4dabf7' : '1px solid rgba(74, 171, 247, 0.2)',
                '&:hover': {
                  transform: 'translateY(-10px)',
                  boxShadow: '0 20px 40px rgba(74, 171, 247, 0.2)',
                },
              }}
            >
              {project.featured && (
                <Chip
                  icon={<Star />}
                  label="Featured"
                  color="primary"
                  size="small"
                  sx={{
                    position: 'absolute',
                    top: 16,
                    right: 16,
                    zIndex: 1,
                    fontWeight: 600,
                  }}
                />
              )}

              {/* Project Image/Icon */}
              <Box
                sx={{
                  height: 200,
                  background: 'linear-gradient(135deg, #4dabf7, #f50057)',
                  display: 'flex',
                  alignItems: 'center',
                  justifyContent: 'center',
                  fontSize: '4rem',
                  position: 'relative',
                  overflow: 'hidden',
                }}
              >
                {project.image}

                {/* Hover Overlay */}
                <Box
                  sx={{
                    position: 'absolute',
                    top: 0,
                    left: 0,
                    right: 0,
                    bottom: 0,
                    background: 'rgba(0, 0, 0, 0.8)',
                    display: 'flex',
                    alignItems: 'center',
                    justifyContent: 'center',
                    gap: 2,
                    opacity: 0,
                    transition: 'opacity 0.3s ease',
                    '&:hover': {
                      opacity: 1,
                    },
                  }}
                  className="project-overlay"
                >
                  <Button
                    variant="contained"
                    startIcon={<GitHub />}
                    href={project.github}
                    target="_blank"
                    size="small"
                  >
                    Code
                  </Button>
                  <Button
                    variant="outlined"
                    startIcon={<Launch />}
                    href={project.demo}
                    target="_blank"
                    size="small"
                    sx={{ color: 'white', borderColor: 'white' }}
                  >
                    Demo
                  </Button>
                </Box>
              </Box>

              <CardContent sx={{ flexGrow: 1, p: 3 }}>
                <Typography variant="h5" sx={{ fontWeight: 600, mb: 1 }}>
                  {project.title}
                </Typography>
                <Typography
                  variant="body2"
                  sx={{ color: 'text.secondary', mb: 2, lineHeight: 1.6 }}
                >
                  {project.description}
                </Typography>

                <Box sx={{ display: 'flex', flexWrap: 'wrap', gap: 0.5 }}>
                  {project.technologies.map((tech, index) => (
                    <Chip
                      key={index}
                      label={tech}
                      size="small"
                      variant="outlined"
                      sx={{
                        fontSize: '0.75rem',
                        height: 24,
                        borderColor: 'rgba(74, 171, 247, 0.3)',
                        color: 'text.secondary',
                      }}
                    />
                  ))}
                </Box>
              </CardContent>
            </Card>
          </Grid>
        ))}
      </Grid>

      {/* CTA Section */}
      <Paper
        sx={{
          p: 4,
          textAlign: 'center',
          background: 'linear-gradient(135deg, rgba(15, 1, 52, 0.9), rgba(13, 1, 47, 0.9))',
          border: '1px solid rgba(74, 171, 247, 0.2)',
          borderRadius: 4,
        }}
      >
        <Typography variant="h4" sx={{ fontWeight: 700, mb: 2 }}>
          Want to see more?
        </Typography>
        <Typography variant="body1" sx={{ color: 'text.secondary', mb: 3, maxWidth: 500, mx: 'auto' }}>
          Check out my GitHub for more projects and contributions
        </Typography>
        <Button
          variant="contained"
          size="large"
          startIcon={<GitHub />}
          href="https://github.com/yourusername"
          target="_blank"
          sx={{ px: 4, py: 1.5 }}
        >
          Visit GitHub Profile
        </Button>
      </Paper>
    </Container>
  );
};

export default Projects;
